def generate_forest_plan(n, m):
    arr = [[0] * m for _ in range(n)]
    if m > 4:
        arr[0] = list(range(m - 1, 0, -2)) + list(range(m, 0, -2))
        for i in range(1, n):
            for j in range(m):
                arr[i][j] = arr[i - 1][j] + m
    elif n >= 4:
        for (ind, i) in enumerate(list(range(n - 1, 0, -2)) + list(range(n, 0, -2))):
            arr[ind][0] = i
        for j in range(1, m):
            for i in range(n):
                arr[i][j] = arr[i][j - 1] + n
    elif n == 2 and m == 3:
        arr = [[3, 6, 2], [5, 1, 4]]
    elif n == 3 and m == 2:
        arr = [[3, 5], [6, 1], [2, 4]]
    elif n == 3 and m == 3:
        arr = [[1, 7, 4], [3, 9, 6], [5, 2, 8]]
    elif n == 1 and m == 1:
        arr = [[1]]
    else:
        return -1
    return arr

